import React, { useState } from "react";
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBInput,
  MDBDialog,
  MDBDialogTitle,
  MDBDialogContent,
  MDBDialogActions,
} from "mdb-react-ui-kit";

function FileUpload() {
  const [selectedAudioFile, setSelectedAudioFile] = useState(null);
  const [selectedMidiFile, setSelectedMidiFile] = useState(null);
  const [selectedFormat, setSelectedFormat] = useState("");
  const [openArtistSelection, setOpenArtistSelection] = useState(false);
  const [selectedArtist, setSelectedArtist] = useState("");
  const [artistCounts, setArtistCounts] = useState({
    "Amr Diab": 0,
    "Om Kalthoum": 0,
    "Sayed Darwish": 0,
    Abdelhalim: 0,
    Abdelwahab: 0,
    "Mickael Jackson": 0,
  });

  const [artistImages] = useState({
    "Amr Diab": "/public/assets/amrdiab.jpeg",
    "Om Kalthoum": "public/assets/omkalthoum.jpeg",
    "Sayed Darwish": "public/assets/sayeddarwish.jpeg",
    Abdelhalim: "public/assets/abdelhalim.jpeg",
    Abdelwahab: "public/assets/abdelwahab.jpeg",
    "Mickael Jackson": "public/assets/jackson.jpeg",
  });

  const handleAudioFileChange = (event) => {
    setSelectedAudioFile(event.target.files[0]);
  };

  const handleMidiFileChange = (event) => {
    setSelectedMidiFile(event.target.files[0]);
  };

  const handleFormatChange = (event) => {
    setSelectedFormat(event.target.value);
  };

  const handleUpload = () => {
    console.log("Audio file uploaded:", selectedAudioFile);
    console.log("MIDI file uploaded:", selectedMidiFile);
    console.log("Selected format:", selectedFormat);
  };

  const handleOpenArtistSelection = () => {
    setOpenArtistSelection(true);
  };

  const handleCloseArtistSelection = () => {
    setOpenArtistSelection(false);
  };

  const handleSelectArtist = (artist) => {
    setSelectedArtist(artist);
    const updatedCounts = { ...artistCounts };
    updatedCounts[artist]++;
    setArtistCounts(updatedCounts);
    setOpenArtistSelection(false);
  };

  return (
    <MDBContainer className="my-5 gradient-form">
      <MDBRow>
        <MDBCol col="6" className="mb-5">
          <div className="d-flex flex-column ms-5">
            <div className="text-center">
              <h4 className="mt-1 mb-5 pb-1">File Upload</h4>
            </div>
            <p>Please upload your files</p>
            <input
              type="file"
              accept="audio/*"
              onChange={handleAudioFileChange}
              style={{ display: "none" }}
              id="audio-file-input"
            />
            <input
              type="file"
              accept=".mid,.midi"
              onChange={handleMidiFileChange}
              style={{ display: "none" }}
              id="midi-file-input"
            />
            <MDBBtn
              onClick={handleOpenArtistSelection}
              className="mb-4 w-100 gradient-custom-2"
            >
              Select Your Favorite Artist
            </MDBBtn>
            <MDBInput
              label="Select Audio File"
              disabled
              value={selectedAudioFile ? "Audio File Selected" : ""}
              className="mb-4"
            />
            <MDBInput
              label="Select MIDI File"
              disabled
              value={selectedMidiFile ? "MIDI File Selected" : ""}
              className="mb-4"
            />
            <MDBInput
              select
              label="Select Format"
              value={selectedFormat}
              onChange={handleFormatChange}
              className="mb-4"
            >
              <option value="format1">WAV</option>
              <option value="format2">UpScaling</option>
              <option value="format3">SVS</option>
            </MDBInput>
            <MDBBtn
              onClick={handleUpload}
              disabled={
                !selectedAudioFile || !selectedMidiFile || !selectedFormat
              }
              className="mb-4 w-100 gradient-custom-2"
            >
              Upload
            </MDBBtn>
          </div>
        </MDBCol>
        <MDBCol col="6" className="mb-5">
          <div className="d-flex flex-column justify-content-center gradient-custom-2 h-100 mb-4">
            <div className="text-white px-3 py-4 p-md-5 mx-md-4">
              <h4 className="mb-4">Artists Selection</h4>
              <MDBDialog
                open={openArtistSelection}
                onClose={handleCloseArtistSelection}
              >
                <MDBDialogTitle>Select Your Favorite Artist</MDBDialogTitle>
                <MDBDialogContent>
                  {Object.keys(artistCounts).map((artist, index) => (
                    <div
                      className="d-flex flex-column align-items-center mb-4"
                      key={index}
                    >
                      <img
                        src={artistImages[artist]}
                        alt={artist}
                        style={{
                          width: "100px",
                          height: "100px",
                          borderRadius: "50%",
                        }}
                      />
                      <p className="mt-2">{artist}</p>
                      <MDBBtn
                        onClick={() => handleSelectArtist(artist)}
                        className="mb-4 gradient-custom-2"
                      >
                        Select
                      </MDBBtn>
                    </div>
                  ))}
                </MDBDialogContent>
                <MDBDialogActions>
                  <MDBBtn onClick={handleCloseArtistSelection} color="primary">
                    Close
                  </MDBBtn>
                </MDBDialogActions>
              </MDBDialog>
            </div>
          </div>
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
}

export default FileUpload;
